INSERT INTO `items` VALUES (344,'Pioneer 250 Sleeping Bag','38728-150115160149-791591112.jpg',114,'The Hi Gear Pioneer 250 Sleeping Bag combines a great balance of light weight and cosy warmth, giving you complete comfort and really good value for money.The insulation is a double layered 250g/m2 synthetic Hollowfibre which traps warm air close to the body, and will even perform well when damp. The ripstop outer fabric is soft yet durable, while the brushed polyester lining gives you great next to skin comfort. Neck and zip baffles help to eliminate drafts and cold spots, with the drawcord letting you close the hood around your head in colder conditions, whilst the full length zip allows you to ventilate the bag if you get too warm.Ideal for spring to autumn camping,  the Pioneer 250 has all the features you need to sleep in comfort in the outdoors - theres even a handy inner pocket to stash your phone/mp3 player.It also comes in its own stuff sack, compressing down easily to a decent pack size that wont take up much room, or weigh you down.','A great 2-3 season sleeping bag which is lightweight, with warm synthetic insulation'),(345,'Crag Mountain Bike','52282-2508161226461973763845.jpg',163,'The Calibre Crag Mountain Bike gives you great value XC performance with full Shimano shifting, mechanical disc brakes and Suntour suspension forks, with a fresh new livery for 2016. The frame itself is constructed from aerospace-grade 6061 aluminium, hydroformed for optimum trail ruggedness and precisely hand-welded at every join. The geometry is designed around the 26\"\" wheels for classic XC handling while modern touches like a slackened head angle bring things right up the minute with better handling on tougher trails. Suntour XCT forks provide 100mm of responsive, coil-sprung front suspension to keep you in control over rough terrain. Full Shimano shifting ensures an efficient drivetrain to keep you moving fast. A 24x34x42T triple chainset combines with a 7-speed rear derailleur for a huge range of 21 gears, each of which is easily, quickly, and smoothly accessible with the Shimano EZ-Fire shifters on your handlebars. Whatever the terrain throws at you, youll have a gear to handle it. When you do need to slow down, powerful mechanical disc brakes with 160mm rotors will provide the stopping power consistently and reliably every time. The bike rolls on 26\"\" wheels with durable double-wall alloy rims and hardwearing steel hubs. 26\"\" wheels are easier to control than bigger 27.5\"\" or 29\"\" wheels, making them great for newer mountain bikers who are still honing their skills. The wheels are shod with 2.1\"\" tyres with a fast and grippy tread for great versatility in varied conditions and terrain. In short, the Crag is like the Two.Two but even better. The frame has proven itself time and time again, impressing experts in the media and regular Go Outdoors customers alike. With a brand new spec and the same amazing value for money, the Crag is set for even bigger things.','A classic hardtail mountain bike which builds on the success of the award-winning Calibre Two.Two.'),(346,'Women\"\"s Sherpa 65 Rucksack','56302-2402170949541177228853.jpg',110,'A tough and functional Vango classic. the Womens Sherpa 65 backpack is versatile enough to adapt to your changing circumstances and load. keeping you comfortable as you walk.The Sherpa 65s adjustable. ventilated back system coupled with the shaped. adjustable harness lets you customise the fit as you move. and there are plenty of pocket and organisation options to help you stabilise your load for a less troublesome trek.','Ideal for DofE expeditions and longer stays away from home.'),(423,'Airgo Solus Horizon 320 Inflatable Driveaway','50190-140616143819-1700236111.jpg',95,'The Airgo Solus Horizon 320 Driveaway awning adds a large and spacious shelter to the side of your vehicle or caravan. It\"\"s easy to set up, with multiple inflation points (one on each air beam) and comes with a pump so you\"\"re ready to go.Once it\"\"s pitched you can unhook it from your vehicle, drive away and leave it standing, ready for your return.','An easily set up, freestanding add-on shelter that gives you a large extra living space for your weekend breaks or summer camping holidays.'),(424,'Airgo Stratus 400 Porch','57073-280317120309-1700236111.jpg',96,'The Airgo Stratus 400 Porch uses inflatable, interconnected beams for simple and rapid pitching, so you can add a huge area to your Stratus 400 tent and double up your shelter and recreation room!Airgo tents\"\" inflatable beam construction takes the hassle out of camping. Just pump up the highly robust double skinned beams, and you have a rigid pole-free frame in minutes. All the beams are connected so they inflate from a single inflation point.It uses zips to attach next to the side door of the tent, and strong guying points and multiple guy lines ensure that it will stay stable and in one piece, even in unforgiving weather. And when it\"\"s time to take your camp down, it packs away into its own \"\"Easy Pack\"\" bag with little effort.Inflates in under a minute\"\"Easy Pack\"\" tent bag','Get more from your Airgo Stratus 400 tent with this simple add-on extension.'),(425,'Airgo Stratus 400 Inflatable Tent','52865-0510161511501864066769.jpg',96,'The Airgo Stratus 400 tent is a comfy, sturdy space that uses inflatable, interconnected beams for simple and rapid pitching. It\"\"s got plenty of room for four campers, with a good sized front porch for storing your boots, bags and any other essential kit.Airgo tents\"\" highly robust double skinned inflatable beams take the hassle out of camping - just pump them full of air and you have a rigid pole-free frame in minutes. All the beams are connected so they inflate from a single inflation point.The inner tent is made from breathable fabric for good airflow, with side storage pockets to help you stay tidy and organised. The bedroom area uses light-blocking fabric to stay dark and cool, making for a better night\"\"s sleep (or afternoon nap!)Strong guying points and multiple guy lines keep it stable and in one piece, even in unforgiving weather. And when it\"\"s time to take your camp home, it packs away into its own \"\"Easy Pack\"\" tent bag with the minimum of effort.Comes with a stirrup pump for fast inflation - inflates in under a minute!Comprehensive repair kit included\"\"Easy Pack\"\" tent bag','A spacious tent for four that sets up in just a few minutes with minimal effort'),(426,'Calibre Crag Mountain Bike','52282-250816122646-1700236111.jpg',163,'The Calibre Crag Mountain Bike gives you great value XC performance with full Shimano shifting, mechanical disc brakes and Suntour suspension forks, with a fresh new livery for 2016. The frame itself is constructed from aerospace-grade 6061 aluminium, hydroformed for optimum trail ruggedness and precisely hand-welded at every join. The geometry is designed around the 26\"\" wheels for classic XC handling while modern touches like a slackened head angle bring things right up the minute with better handling on tougher trails. Suntour XCT forks provide 100mm of responsive, coil-sprung front suspension to keep you in control over rough terrain. Full Shimano shifting ensures an efficient drivetrain to keep you moving fast. A 24x34x42T triple chainset combines with a 7-speed rear derailleur for a huge range of 21 gears, each of which is easily, quickly, and smoothly accessible with the Shimano EZ-Fire shifters on your handlebars. Whatever the terrain throws at you, you\"\"ll have a gear to handle it. When you do need to slow down, powerful mechanical disc brakes with 160mm rotors will provide the stopping power consistently and reliably every time. The bike rolls on 26\"\" wheels with durable double-wall alloy rims and hardwearing steel hubs. 26\"\" wheels are easier to control than bigger 27.5\"\" or 29\"\" wheels, making them great for newer mountain bikers who are still honing their skills. The wheels are shod with 2.1\"\" tyres with a fast and grippy tread for great versatility in varied conditions and terrain. In short, the Crag is like the Two.Two but even better. The frame has proven itself time and time again, impressing experts in the media and regular Go Outdoors customers alike. With a brand new spec and the same amazing value for money, the Crag is set for even bigger things.','A classic hardtail mountain bike which builds on the success of the award-winning Calibre Two.Two.'),(427,'Calibre Rivelin 2.0 Road Bike','51364-180716092441-1700236111.jpg',162,'The Calibre Rivelin 2.0 Road Bike boasts an alloy frame, carbon fork and a full Shimano Tiagra groupset - everything you need to excel in your first sportive or road race.Its double-butted 6061 alloy frame uses compact geometry that combines long-distance comfort with nippy handling, while the aluminium tubing is contoured for low weight and high stiffness.Slim seat stays offer controlled vertical compliance to dampen bumps and vibrations in the road. A carbon fibre fork cuts weight further and soaks up road buzz for added comfort. A tapered steerer adds extra front-end stiffness for razor-sharp control around high-speed corners.Shimano\"\"s Tiagra components feature pro-level technology developed and tested at the highest levels of international competition. Between the 10-speed cassette and compact 50/34T double chainset, you have a range of gears wide enough to get up any hill.The Shimano R500 wheelset boasts a semi-aero rim profile that cuts through the air for great speed. Lightweight aluminium construction makes for speedy acceleration and easier climbing, and Shimano hubs roll on smooth, easy to maintain cup-and-cone bearings. The grippy Schwalbe Lugano tyres deliver all-weather performance.The cockpit, stem, handlebar and headset all come from FSA\"\"s performance range. FSA provide the seatpost as well, with a micro-adjust saddle clamp for easy tweaks to the fit of the bike. Finishing things off is a sport saddle from the Italian experts at Selle Royal.','A race-ready road machine that gives you true all-round performance.'),(428,'Coleman Cortes Octagon 8 Tent','54984-050117103050-1700236111.jpg',96,'Coleman\"\"s eye-catching Cortes Octagon 8 is a stylish, spacious tent that\"\"s more like a comfy and adaptable outdoor space that you can tailor to suit your needs.It\"\"s a single large room, with a removable partition curtain that can segregate it into two areas.It gives you a full 360° view of your surroundings, and six of the eight sides open up completely, allowing lots of air and light into the tent. The two remaining sides feature a doorway with the patented Coleman \"\"Hinge Door\"\" that functions like an actual door, swinging open and shut, so entering and leaving is less of a chore. The flysheet can be removed to transform the tent into a bug-proof screen room, perfect for summer days in the garden or the park. It comes in a sturdy wheeled carrybag, so it\"\"s very easy to transport.Total area: 15.7m²Fabric: Pu coated polyester with taped seamsFully integrated PE welded groundsheet','Make your camping trip more of a glamping experience.'),(429,'Compass Fast Forward Folding Bike','57306-040417145908-1700236111.jpg',164,'Easy to ride and easy to carry, combining speed and practicality for commuters using public transportClever folding alloy frame designed for light weight and bulk-free transportation and storageEfficient 8-speed Shimano Claris gearing with a wide-range 12-32T cassette that\"\"s great for varied terrainTough, lightweight 20\"\" double wall alloy rims that are faster than their small size might suggestFinished with a performance Compass Fast Forward saddle and lock on handlebar grips','Easy to ride and easy to carry, this folding bike offers the perfect balance of speed and practicality for commuters using public transport'),(430,'Compass Latitude Hardtail Mountain Bike','52517-130916093903-1700236111.jpg',163,'The Compass Latitude will allow you to tackle a more varied terrain with added comfort and control.Built around a lightweight alloy frame this bike is well equipped with a front suspension fork to soak up rougher ground, allowing you to easily venture into new territory. Nicely equipped with a 21 speed gearing system to ensure no terrain is too challenging, and you will be rolling quick and efficiently on two semi slick tyres for lower resistance.When you need to hit the brakes the alloy V-brakes will deliver a sharp and powerful stop.','A lightweight front suspension mountain bike for tackling varied terrain.'),(431,'Compass Local Men\"\"s Hybrid Bike','57343-040417163436-1700236111.jpg',164,'Durable trekking-style aluminium frame with a sturdy steel fork designed to dull vibrations from rough road surfacesMake hills a breeze with smooth 21-speed Shimano gears and simple-to-use EZ-Fire shiftersAdjustable stem and comfort saddle ensures a comfy riding position for bumpy city streetsReady to roll with chromoplastic full length mudguards, rear carrier rack and chain guard','An ultra-dependable city bike with everything you need to get around town quickly and comfortably in a simple and easy-to-use package.'),(432,'Cuda Kinetic 24\"\" Kids\"\" Mountain Bike','52845-051016102431-1700236111.jpg',170,'Alloy frame with Zoom suspension forkAlloy V-brakes and leversMicro adjustable seat post so you can set up the bike to perfectly suit the riderQuick release seat clamp for easy saddle height adjustment18 speed Shimano gears with Revo twist shifterKenda tyres for multiple terrainsCorrectly scaled saddle to give a better riding position','A serious kids\"\" mountain bike with a wide range of gears.'),(433,'Dahon Vybe D7 Folding Bike','51225-120716144822-1700236111.jpg',164,'The Dahon Vybe D7 has been designed for total convenience and comfort, with long-lasting components (from a Radius handlepost to Fusion and V-Clamp technologies) and the Dahon II Frame Geometry which ensures a 