sold separately), and simple to store away when it\"\"s not needed.Weight: 8oz (240g)Size: 10\"\" x 13\"\" x 12\"\" (26cm x 32cm x 30cm)','Durable, quick mounting protection from sun or rain for your Deuter child carrier (sold separately).'),(436,'Forme Longcliffe 0 Road Bike','48878-040416153417-1700236111.jpg',162,'The Forme Longcliffe 0 is their first road bike to use discs, with a high quality complete Shimano 105 11 speed groupset for smooth and accurate shifting, a handbuilt wheelset consisting of sealed bearing polished hubs and Mavic CXP22 rims.Frame and forks complete with mudguard mounts for year-round training and ridingComplete 4ZA Cirrus stealth cockpit gives professional control','Performance alloy road bike from the Derbyshire brand, tested and proven in the Peak District with quality lightweight components making light work of the local hills.'),(437,'Freedom Trail Sollia 4 Inflatable Tent','48562-110316110341-1700236111.jpg',96,'The Freedom Trail Sollia 4 Tent has a simple layout that gives you plentiful headroom, with space for you and your gear.The roomy porch/entrance area is great for a small table and chairs, or just a quick shelter from the rain.It comes with a pump, to inflate the beams.','A basic but roomy tent for four with inflatable beams for poles - set it up in minutes and you\"\"re ready to camp.'),(438,'Hi Gear Zenobia Elite 6 Tent','52935-111016121607-1700236111.jpg',96,'Ideal for family camping, the Hi Gear Zenobia Elite 6 is a spacious 6-person tent with flexible door and bedroom options and room for your gear, your furniture and yourselves.Darkened bedrooms for a more restful sleeping environment  - new for 2017!Dual cable access points  - new for 2017!\"\"Easy Pack\"\" tent bag  - new for 2017!Simple to pitchFully sewn-in groundsheetPre-attached guylinesHanging storage pocketsHi Gear are winners of the \"\"Best Budget Tents\"\" and \"\"Best Family Tents\"\" categories in the Camping and Caravanning Club\"\"s Tent Owner Satisfaction Awards 2017The tent\"\"s wide tunnel style gives you excellent headroom throughout, and the large living space has hanging storage pockets to help you keep your kit organised, and electrical cable access for you to hook up your appliances.','A roomy family tent with generous headroom and plenty of space for you and your gear.'),(439,'Lifeventure Hydroseal Waterproof Phone Pouch','57371-040417172318-1700236111.jpg',108,'With a very durable IPX7-rated, TPU-laminated 420D nylon fabric, the case ensures that anything from an outdoor swimming pool to a desert is protected against. You can use the phone as normal with the touch sensitive window, attach it around your neck with the provided cord lanyard, or to your gear with the lash points.Durable TPU-laminated 420D nylon fabricIPX7 rated - Waterproof up to 1 metre for 30 minutesLash points for portrait or landscape orientationPrevents dust ingressionHeavy duty LocTop closure with additional secure closureAdjustable nylon cord lanyard and cord lock providedRecommended by Ordnance Survey22g weight194 x 121mm, with a 174mm opening','A pouch to protect your phone from the elements - perfect for all sorts of outdoor holidays and activities.'),(440,'LittleLife Big Gruffalo Kids Backpack','45453-091115172432-1700236111.jpg',109,'Perfect for strolls through the deep dark wood, LittleLife\"\"s Big Gruffalo Kids\"\" Backpack will scare away any other monsters.Adjustable shoulder straps allow for those predictable growth spurts, while the zipped entry main compartment has plenty of space for their everyday needs and favourite toys.Top grab handleChest strapInternal name & address tagWeight: 220gCapacity: 4 litresDimensions: 18cm x 22cm x 27cm (7\"\" x 8?\"\" x 10?\"\")Suitable for children aged 3+ yearsComplies with General Product Safety Regulations','He may be scary with his terrible tusks and claws, but he?ll do them no harm when they wear this kids\"\" backpack.'),(441,'OEX Hydra 1.5','47101-120116164928-1700236111.jpg',108,'If you are not too keen on taking a big bag out with you but want to stay hydrated then the OEX Hydra 1.5 is a great choice. The pack comes already integrated with a new 1.5 litre TPU hydration bladder with on/off bite-valve. It has a bungee cord strap on the outside for securing clothing layers you may have discarded. Separate sections within the bag give you room to organise you stuff before setting off.Finally it has a reflective bike light strap to make sure you are seen in low light.Lightweight, mesh shoulder straps that help overall breathabilityChest strap with elastic lung expansion section','A compact lightweight Hydration Pack suitable for days on the trail or cycle adventures.'),(442,'OEX Lynx EV II Backpacking Tent','47393-200116110621-1700236111.jpg',96,'Designed to be the perfect choice for weight concious campers, the OEX Lynx EV II Backpacking Tent is ideal for expeditions, wild camping and cycling/kayak trips.New for 2017, the eyelets on all of the OEX EV range of tents have been changed to a much improved Clasp method, which has now resolved a slight issue that was previously encountered in the original versions.It\"\"s made from a tough, lightweight Nylon 30D / 270T fabric core which has been coated inside with PU (Polyurethane) to aid strength, waterproofing and seam sealing. On the outside there is a SI (Silicone) membrane which provides a flexible but highly water resistant coating that beads and repels water, whilst flexing in heavy windy conditions. The Yunan T6 tent poles are used by many high end manufacturers and, with their Japanese grade Aluminium and bespoke Korean engineering, are made to perform in all conditions whilst maintaining their integrity over many years of use.A new guy line tensioning system utilises an Aluminium OEX ?O? Ring, which is an extremely lightweight but resilient component that lets you easily make adjustments, even when wearing gloves.It comes with strong aluminium stake pegs that won\"\"t weigh you down and, due to the lightweight nature of the OEX EV series, everything packs down into just a single waterproof dry bag. *Please see the info tab for more details on the Yunan poles','A excellent 2 person backpacking tent, built for those who want lightweight performance with a touch of style.'),(443,'OEX Puma II Tent','53056-131016113122-1700236111.jpg',97,'Ideal for individuals or group expeditions, the OEX Puma II is a semi-geodesic dome tent built to cope with the harshest conditions.3 equal length ?Easyglide? poles make pitching simple, while the two entry points help to make it a very practical and robust shelter. One of the entry points has a small storage area for your wet kit.*Please note, the product swing tag incorrectly states that the HH rating is 5000 when it should actually be 4000.','A light and robust tent for one or two adventurers.'),(444,'OEX Vallo 28 Rucksack','45026-271015160621-1700236111.jpg',111,'The OEX Vallo 28 Rucksack is ideal for quick trips out, long days on the trail and outdoor climbing adventures.It has a breathable AirBack ventilation system that\"\"ll keep you cool and dry with minimal friction, and a shoulder and hip strap system that disperses the weight to help minimise fatigue.You can access the main compartment from both the top and side, so you can easily reach all your gear, even if it\"\"s at the bottom of your pack.There are multiple pockets throughout the pack,with dual compression straps either side for greater weight distribution, and double walking pole/ice axe attachment points in case you need your hands free.With rugged ripstop fabrics, high quality components, stress point strengthening and a host of innovative features it truly is built to last and perform at the highest level.Hydration compatible with access points on either sideDurable buckles and zipsClimbing rope securing strapExpanding front jacket pocketTop lid pocketSide entry pocket2 side stretch pockets*Please note, the slightly larger Vallo 35 Rucksack is also now available.','A compact, lightweight and fully featured rucksack which is perfect for alpine climbers and hill walkers.'),(445,'Orbea Avant H70 Road Bike','49559-160516144527-1700236111.jpg',162,'Hydroformed triple butted aluminum frame for lightweight, responsive performanceCarbon fork provides razor-sharp handling while absorbing unwanted road vibrationsEndurance frame geometry ensures lasting comfort on long road ridesShimano Tourney shifting is fast and precise over a full range of 21 gears*Please note, the image shown is for illustrative purposes only. The actual product comes with a black saddle and black grip-taped handlebars.','An accessible entry point into the world of road cycling, this comfortable and easy to ride bike has a wide spread of gears to help with challenging hills.'),(446,'Osprey Atmos AG 65 Rucksack','55876-060217154807-1700236111.jpg',112,'With an AG AntiGravity? suspended backsystem that incorporates the world?s first fully ventilated hipbelt, you?re in a good position to explore anything from the Amazon to the Antarctic; the seamless mesh and 3D cavity back panel provides great breathability for your back alongside its top-notch support.The carrying performance is similarly superb - this bag can be filled to the absolute max and still feel light. This is brought about by ExoForm? Biostretch? harness, load lifter bar and Fit-on-the-Fly? hipbelt, alongside InsideOut? compression. These features innovatively compact your load and distribute its weight, with fantastic results.Though compressed, your gear is easy to access at all times. The twin zippered pockets, base zip and top-lid entry points see to this, ensuring you can always get what you need, when you need it. Likewise, your sleeping bag is stored in a separate compartment, so you always know its location when you want to get your head down after a long day.Externally, the bag is loaded with handy quick-access features and pockets, with Stow-on-the-Go? trekking poles, a detachable raincover and numerous other clever considerations. From ice axe loops to integrated whistles, and a FlapJacket? top cover for using the bag without a lid, Osprey have thought carefully about the necessities of backpacking and trekking.With numerous awards under its belt for its innovations, the Osprey Atmos is both market-leading and game-changing; an extremely well designed backpacking rucksack.Adjustable AG AntiGravity? 3D suspended mesh backsystemAntiGravity? 3D suspended mesh backpanel/hipbeltBase zip entryCompatible with Hydraulics? ReservoirExoForm?/BioStretch? harness with load lifter \"\"bar\"\"External probe and shovel handle sleevesFit-on-the-Fly? adjustable hipbeltFlapJacket? top cover for use without lidIntegrated & detachable raincoverInternal hydration sleeveInternal top load compression strapLight weight peripheral frameRemovable sleeping pad strapsSleeping bag base compartment with internal dividerSternum strap with emergency whistleStow-on-the-Go? trekking pole attachmentStretch mesh side pocketsTop lid accessTwin ice axe loopsTwin zippered easy access front pocketsTwin zippered hip belt pockets','Brimming with innovative features, the Atmos 65 sets a new standard in backpacking.'),(447,'Osprey Exos 48 M Rucksack','52032-160816104152-1700236111.jpg',111,'\"\"A great hillwalking pack for those wanting a combination of low weight and comfort\"\" - Trail Magazine, Best In Test September 2016The Osprey Exos 48 combines size, comfort and clever design in a lightweight rucksack that\"\"s ideal for multi-day treks.Osprey\"\"s Airspeed suspended mesh back panel provides a stable, supported load carrying platform that keeps the load slightly away from your back to allow air to circulate, so you stay cool and dry. The dual-mesh constructed ExoFoam harness and hip belt provides extra stability for a comfortable all-round fit.On the outside of the bag there are plenty of storage solutions - Stow-on-the-Go loops allow you to attach your trekking poles without removing the pack from your back, a side loop lets you easily carry an ice axe, while extra storage comes from zipped hip pockets for small essentials, side mesh pockets for bottles and a front stretch pocket, ideal for keeping wet clothing separate from your other gear.Side straps allow you to compress the bag down when it isn\"\"t full, and the top lid can be removed completely, with a unique Osprey FlapJacket ensuring your equipment is still protected inside.Internal sleeve for hydration systemsRemovable sleeping pad strapsSternum strap with emergency whistle','A unisex hiking pack that skips on weight but not on features.'),(448,'Osprey Ultralight Drysack (12L)','37775-111114144706-1700236111.jpg',108,'Keeping all of your gear organised and protected is a concern wherever you are and whatever you\"\"re doing.Osprey\"\"s ultralight and tough drysacks are made from siliconised ripstop nylon, so you can trust them to keep your kit protected and visible even in the darkest depths of your pack, and let you colour-code your contents for even quicker access.They\"\"re equipped with a fully waterproof roll-top closure, coated fabric and taped seams that keep whatever\"\"s inside dry no matter how wet your pack gets.Unlike other drysacks they are rectangular, which makes for more efficient packing and means that they can stand unsupported when removed from your backpack.What are you waiting for....  make sure your gear is protected!High visibility, with reflective graphic printFully waterproof roll-top closureFully waterproof coated fabric and seamsRectangular shape for efficient packingWeight: 0.04 kgMaximum dimensions: (mm) 400 (l) x 220 (w) x 130 (d)','Protect your gear and keep it organised with fully waterproof, colour-coded dry bags for inside your pack.'),(449,'Raleigh Caprice Ladies\"\" Town Bike','49721-200516122029-1700236111.jpg',164,'The Raleigh Caprice hides modern components and design behind its retro styling.With 7 gears (changed using the easy rotational Shimano Rev shifter) and powerful alloy v-brakes it will get you where you want to go in smooth style.Comfort colour co-ordinated saddleAluminium micro-adjust seatpostColour co-ordinated steel mudguards, chainguard, rear carrierFront wicker style basketTraditional rubber block pedals','An elegant, graceful bike for those who travel in style.'),(450,'Robens Klondike Tipi Tent','54886-040117113710-1700236111.jpg',94,'Robens\"\" Outback tents give families and groups a better, more comfortable and more stylish outdoor experience. The tents have a distinctive look that harks back to the olden days of camping, but they\"\"re made using technical, highly breathable HydroTex? Polycotton fabric with a water repellent treatment and have plenty of customisation options, so their versatility and warm-weather comfort really sets them apart from the norm.The roomy Robens Klondike tipi will comfortably house up to six campers, with retro looks reminiscent of a traditional Scout tent or bell tent.It will keep you dry in heavy rain but won\"\"t get stuffy inside. The groundsheet has a zip that runs from the door to the centre, allowing you to fold it back to create a \"\"wet area\"\" or make room for a tent stove. An elasticated stovepipe port allows the use of a solid fuel stove (like the Denali tent stove), and the adjustable top vent lets you control air circulation.A separately available four-person inner tent  lets you add some cosy privacy, and for an extra-homely feel, try the Klondike Flooring for plush comfort underfoot.Breathable HydroTex? Polycotton fabricGroundsheet part unzips to centre and folds backAdjustable top vent protection for good air circulation in all weathersOptional four-person inner tent and plush carpet availableGuyline retainers make pitching and packing simpler','A smaller tipi tent that will sleep six campers in roomy, stylish comfort.'),(451,'Shimano WM53 Women\"\"s Off-Road Sport Cycling Shoes','49326-030516173052-1700236111.jpg',194,'3 durable hook & loop straps spread tightening force across the top of the footCross X Strap alleviate pressure when off the bikeTough, stretch-resistant synthetic leather and meshFibreglass-reinforced nylon sole with polyurethane lugsArch pad for un-clipped stability, Mud-shedding outsole lugs allows mud debris to fall through','Tough and comfortable women\"\"s-specific cycling shoes with a secure fit.'),(452,'TFGear Airflow Bivvy (2 Man)','57646-130417123029-1700236111.jpg',99,'Erected in under one minute using tough, puncture-resistant ?air poles?Rock solid in the windiest conditionsTough, durable all-season protection - will withstand years of use100% waterproof nylon, built in heavy-duty groundsheetSet to revolutionise carp fishing shelters, The TF Gear Airflo Bivvy uses quick inflate ?air poles? instead of conventional metal poles making set-up very quick and easy. The strong, rigid ?air poles? will remain firm and unmoving in the most extreme conditions (in tests the Airflo has proved to be at least as stable as any conventional pram hood bivvy) - just pump them full of air (quick action pump provided) and you have a rock solid, super stable bivvy in about a minute! ','An \"\"inflatable\"\" bivvy that uses air tubes in place of poles. Set it up in one minute and you\"\"re ready to fish!'),(453,'Vango Icarus 500 Deluxe Tent','31568-210114165058-1700236111.jpg',98,'The Vango Icarus 500 Deluxe\"\"s combination of space, flexibility and simplicity keep it popular with anyone looking for a weekend tent for family camping or festival visits. Now with more sleeping space, larger windows and adjustable low level ventilation, the Icarus 500 keeps evolving and improving. Pitching is a breeze - the Powerflex fibreglass poles slide through the heavy duty pole sleeves and are easily secured with a ring and pin system, allowing you to erect and collapse the tent \"\"as-one\"\" and keep the inner tent dry. In windy conditions the Vango Tension Band System makes the Icarus more sturdy and stable against gusts or knocks.The outer is waterproof Protex 4000 polyester with taped seams to prevent leaks, and the fully sewn-in groundsheet is a simple solution for keeping out draughts and creepy crawlies. The enormous front porch is great for storing gear, furniture, bikes etc, and the new larger windows give great all-round visibility and let in lots of light. The side mesh door on the Vango Icarus 500 allows for insect-free ventilation, and the parallel-zip front door can be extended out as a canopy using awning poles (not included).Front and rear venting and a breathable inner keep you comfortable inside, and \"\"comfort colours\"\" (darker over the bedroom) mean there\"\"s no rush to get out of the tent on those bright mornings.It comes with an oversized handled carry-bag that makes packing away simple.Easy pitch tunnel style, pre-attached guylines, sewn-in groundsheetFully wind & rain testedCable entry with cable tidies, hanging storage, reflective webbing, easy-find inner clipsVango AirZone ventilation2 full mesh doors, detachable flexible inner divider, part mesh inner doors','A roomy and easy to pitch base for 5 campers or festival-goers.'),(454,'Vango Nadina 600 Family Tent','31573-220114144018-1700236111.jpg',94,'Vibrantly coloured, very roomy and simple to pitch, Vango\"\"s Nadina 600 is a 5-pole tunnel tent with a pre-attached front extension that gives you extended shelter for relaxing or dining, and a large covered storage area too.The huge internal living area and flexible bedroom compartments (which can be separated with a zipped divider) allow for the sleeping and storage options of your choice.Well ventilated due to Vango\"\"s AirZone design, the Nadina 600 has breathable polyester \"\"Lights Out\"\" inner tents which remain dark even in sunshine, so you won\"\"t be rudely awakened by a hot, bright sunrise. All the entrances have a mesh door allowing ventilation on warm days and nights, while keeping flying insects outside.It pitches quickly and simply, with the flysheet and inner together.  The Protex 70 Denier polyester flysheet is highly waterproof, durable and reliable so will keep you dry and comfortable whether you\"\"re in a downpour or a humid spell.The pocketed pelmet at the front gives you additional storage space, hides the inner tent attachment points, and helps reduce drafts. You also have the option  of \"\"wardrobe\"\" inner tents - a removable hanging pole lets you hang clothes, remove it and you have a bedroom again!As well as comfort, you\"\"re ensured stability due to Vango\"\"s pre-angled pole sections, which create more internal space than with a standard arch, and brace very effectively against side winds.And why not make your camping experience even more homely, by adding underfoot comfort and protection with the Nadina 600\"\"s optional carpet  and footprint.Breathable polyester inner tent- the fabric allows condensation to pass through, ensuring a comfortable nights sleepColour Coded Poles for more intuitive pitchingDuraflex buckles and zip pullers - renowned for strength, quality and reliabilityConveniently positioned inner tent pockets store snacks, torches or electronicsLightweight and low bulk inner tent ground sheet - perfect for sleeping and packing\"\"Line Lok\"\" patented guyline runners lock securely, release simply and perform in all conditionsGuy lines attached at optimum positions for stability and tension (with handy guy line holders)All flysheet and groundsheet seams are factory taped, giving a water tight sealSimple Zip-down curtains allow for varying levels of opening, fit to the flysheet with no gaps and simply roll into a pocket - no more rolling up fiddly curtains!Large Diamond Clear PVC windows for maximum light and great visibilityReflective webbing picks up torchlight, easily visible in darknessWeather tested to the European standard EN5912, in a certified wind and rain test centre.Zipped entry point with hook and loop tidies for electrical cablesLantern 