oors when you camp.','Add warmth and softness underfoot and help to prolong the life of your tent.'),(522,'Hi Gear Zenobia Elite 6 Carpet','31895-260214141412-1700236111.jpg',104,'Designed to fit the living area of your Hi Gear Zenobia Elite 6 Tent/ this carpet adds a touch of luxury/ insulates from the cold ground/ and gives you a more homely feel.It\"\"s warm and comfortable under your feet/ and has a waterproof backing so you\"\"re protected from cold and dampness.240cm x 240cm','Add warmth and comfort underfoot/ to your Hi Gear Zenobia Elite 6 Tent.'),(523,'Quest 5 Pole Windbreak','28661-130613102256-1700236111.jpg',102,'Brightly coloured polythene fabric and wooden poles/ the classic windbreak for at the beach on on the campsite. 152 cm x 240 cm approx.','A cheap and cheerful windbreak to protect you from windchill and give some privacy.'),(524,'Quest 5-Pole Family Windbreak [Green Stripe]','27676-180413151544-1700236111.jpg',102,'Made from a non woven fabric/ with wooden poles and metal spikes and end caps/ the Quest Family Windbreak is useful on the campsite/ at the beach or at a festival.Use it to block wind and provide shelter/ or as a partition between you and your neighbours at the campsite.It comes with an awning rail attachment so you can attach it onto your caravan awning rail.Wooden PolesMetal End CapsMetal SpikesAwning Rail AttachmentLightweightNon-Woven Fabric5 x 20mm diameter polesSize: 123cm high x 345cm wide','A quality windbreak that comes with a caravan awning attachment.'),(525,'Raleigh U-Lock & Cable','57439-050417134031-1700236111.jpg',171,'Raleigh\"\"s U-Lock & Cable set is designed to give you peace of mind when securing your bike.The u-lock uses a quattro bolt locking mechanism which provides superior strength and maximum pull resistance/ locking the cross bar to the shackle on 4 sides. While the user friendly/ pick/ pull and drill resistant onguard z-key cylinder/ featuring bumpblok/ deters would be theives and helps guard against physical attac.Massive 14mm ultra hardened steelShackle provides maximum cut resistanceQuick release multi-position mounting bracketUltra-hardened reinforced crossbarAnti-rattle bumpersIncludes laser cut keys230mm x 14mm u-lock120mm x 10mm heavy duty extra flexible steel cable','A superb security set for your bike/ comprising of a strong u-lock and a heavy duty flexible cable.'),(526,'Compass Combination Cable Lock','48740-290316151306-1700236111.jpg',171,'This fantastic combination lock has 100/000 different combination variations/ and with ergonomic dials for easy use/ inputting the right combination has never been easier. 180 cm flexible coil cable offers a compact lock solutionComplete with mounting bracket so you can attach the lock to your bike5 tumblers give up to 100/000 possible lock combinationsTwisted steel cable provides sturdy securityTough vinyl coating protects your bike from any scratches when in useWeather resistant construction means you can use this lock in all conditionsComes complete with instructions','A flexible 180cm twisted steel cable with built-in combination lock.'),(527,'Scosche boomBARS Wireless Speaker for Bikes','45283-041115152408-1700236111.jpg',182,'Listen to Ride Of The Valkyres whist descending a monster downhill with the Scosche boomBARS Wireless Speaker.  A great little portable media speaker with a unique mounting system that allows you to easily attach to nearly any bike handle bars and when you arrive take the music inside with you.It is compact/ lightweight rugged aluminium housing measures in at just under 2.5\"\" tall and less than 2\"\" wide.It is possible to connect multiple speakers for better sound so you can enjoy an improved listening experience while watching a movie/ playing a game or watching a video.Rotating mount allows you to aim the speaker for optimal audio performance.Battery:  Rechargeable lithium-ion battery provides up to 5 hours of continuous music playback. In The Box: Also includes an audio/USB charging cable and travel pouch.Sound: 35MM Speaker [2W 35mm drivers] that produces 360° of sound.Wireless Range: 30 feetDimensions 45mm x 56mm','A great little portable/ wireless speaker that will keep to keep you entertained on your ride.'),(528,'Avenir Handle Bar Cycling Bag','137766_633717741518906250-1700236111.jpg',182,'An 8 litre capacity/ tough 600 Denier diamond-weave nylon bike bag/ with a quick-release fitting system for easy fitting and removal from the handlebars of your bike.It features many internal pockets/ and side pockets for additional storage.The reflective trim and LED loop help your visibility in the dark/ and it also comes with a high-vis rain cover.It also has a map pocket and GPS security pocket/ and the external zips are waterproof to protect your belongings','Avenir HandleBar Bag/ Quick Release:'),(529,'Black Diamond Ice Screw Up','8924-160310145323-1700236111.jpg',204,'Lightweight pouch for ice screwsSnag free slotsZippered mesh area for capsSecure buckle closure','Simply designed to hold ice screws.'),(530,'Black Diamond Express Ice Screw 22cm','183696_633930349716151250-1700236111.jpg',204,'Your ice screw needs to be fast fixing and with great levels of visibility.Designed by Black Diamond/ these ice screws are perfect for an ergonomic fit and quick placement. Crank knobs with a 360 degree motion make these an excellent choice if you need a quick insertion with minimal fuss/ whilst colour coding makes sure locating your screw/ even in blizzard conditions is an easy feat.Stainless steel hangers with two clip points create a fantastic load bearing style/ for peace of mind on the climb/ and at 16cm in length/ in the middle range of the screw spectrum/ this is the perfect antidote to thick/ compacted ice. Features: Large Crank KnobsColour Coded22cmQuick PlacementEasily Stored','Black Diamond Express Ice Screw- 22cm'),(531,'Grivel G1+ Ice Axe','25189-271112091825-1700236111.jpg',206,'Engineered with all the key characteristics their other axes/ the Grivel G1+ Ice Axe offers top performance in a pared down package. The one piece hot forged head is designed to provide an optimum strength to weight ratio so it won\"\"t let you down/ or weight you down/ when it matters. The head itself incorporates a sturdy adze for digging belays and stances/ with a classic neutral pick on the reverse for harder climbing and self-arrests.    The G1 features a CEN-B rated shaft with clip-able spike and natural rubber hand grip/ and comes with a sprung leash and locking clip. Weight: 475g','Lightweight classic walking axe. Ideal for general alpine travel/ winter walking and classic snow climbs.'),(532,'Petzl Quark Ice Axe with Hammer [50cm]','18736-141111150348-1700236111.jpg',206,'The Petzl Quark Ice Axe is a technical ice climbing tool for vertical and mixed ice climbing. This version comes with a removable hammer fitting for driving in pitons.The Quark is smooth and balanced; the interchangeable ICE T pick is tapered to 3mm for excellent penetration in all ice types/ and is shaped for stable hooking on both rock and ice. The griprest increases climbing comfort and makes it possible for leashless climbing/ and you can also add the Trigrest for even greater flexibility with one or two hands.The Quark is designed for serious ice climbers or those who want to advance onto vertical ice climbs. Curved geometry for a full reachStripped weight: 460gFull weight: 550gT Ice pick included - designed for maximum efficiency and penetration in all types of iceHammer attachment includedSteel spike point for piolet-canneCan be used leashless with the Griprest or Trigrest','Technical ice axe for mountaineering and ice climbing.'),(533,'Black Diamond Raven Axe [with grip and leash]','22830-150812110227-1700236111.jpg',206,'This elegant Black Diamond Raven Ice Axe has a pared down single piece head with adze and classic pick for arresting and belay construction. The slender aircraft aluminium alloy shaft provides the necessary support for walking and negotiating moderate snow slopes yet drives easily into all but the hardest snow packs.     The Raven is equipped with a Slider Leash that helps prevent it disappearing down the mountain as well as providing extra support when engaged in pick work. To further assist when things get technical there is also a dual-density grip at the base of the shaft.With CEN-B certified construction and a carabiner compatible eyelet in the head the Raven is the ideal too for glacial and general mountain travel. ','One of the lightest classic ice axes available/ ideal for glacial travel/ easy mountaineering and winter walking.'),(534,'Climb X Crux Climbing Shoes','30594-301013155420-1700236111.jpg',222,'The Climb X Crux is a unisex climbing shoe that\"\"s suitable for all styles of climbing.They\"\"re made using a durable suede upper/ with an odour-resistant & anti-bacterial hemp lining.Its \"\"X Factor\"\" rubber sole gives excellent grip/ and the \"\"To-the-toe\"\" lacing lets you get a precise fit','A well fitting/ grippy shoe for all types of climbing.'),(535,'Evolv Spark Men\"s Climbing Shoes','48790-310316154201-1700236111.jpg',222,'Made using high quality leather and lined with 3-D Air Mesh in the heel and tongue/ Evolv Spark Climbing Shoes are extremely comfortable and supportive.Their \"\"Enhanced Arch Support\"\" [EAS] technology builds arch structure directly into the outsole/ providing midfoot comfort and support.Built on a newly designed lastMade of high quality leatherProfile: Semi-asymmetricalSole: 4.2 mm TRAX? high friction rubberRand: VTR rand [thicker at toe]Upper: LeatherLining: Unlined leather forefoot/ nylon footbed/ partially lined 3-D Air MeshMidsole: MX-P: 1.0 mm full-lengthTRAX? high friction rubber is formulated to be the highest performing rubber on the market. TRAX? has a perfect balance of high friction and edging power on different types of rock and plastic holds while performing consistently over a wide range of temperatures.','Leather climbing shoes that give the perfect balance of comfort/ support/ and durability.'),(536,'Boreal Diabolo Men\"s Climbing Shoe','55601-240117155937-1700236111.jpg',222,'Boreal\"\"s Diabolo Climbing Shoe has been re-shaped for 2017 to give you even more confidence/ whether taking you\"\"re first steps or a seasoned pro.It\"\"s built around a new last which gives you a low profile/ precision toe shape/ along with a close fitting heel and increased tension at the rand.The high quality split leather and synthetic microfibre upper has an integrated tongue and a double strap closure/ which works with the slim heel to ensure a snug/ secure and comfortable fit.They provide the ideal blend of edging support and long-lasting friction/ all due to the medium stiffness midsole that\"\"s been paired with the sticky and durable Zenith Quattro rubber outsole.Split leather and microfibre upperFast double strap closure systemSpecial anti-deformation/ slip-lasted midsoleUltra sticky BOREAL? Zenith Quattro outsole [4-4.5mm thickness depending on size]Suitable for use indoors or outdoors/ routes or bouldering','A precise yet forgiving shoe that\"s extremely versatile and proves to be a great compromise between comfort and performance.'),(537,'La Sportiva TX4 Approach - Man','55526-190117173950-1700236111.jpg',222,'TX4s combine a durable and stylish leather construction with a lightweight/ comfortable feel. Particular emphasis has been placed on the grip/ comfort and protection that the shoe provides/ with a \"built to last\" outlook that can take you right up to the base of the wall.The STB Control System? provides structure and torsion stability/ and there is fantastic abrasion resistance brought about by the PU TechLite all-around rand. The Vibram MegaGrip sole with climbing zone at the toe and Impact Brake System to the rear provide you with excellent coverage on technical terrain/ and the lacing system regulates tension and internal volume with simple functionality.Shoes for speed/ safety and comfort across a range of routes. Suede leather upper / with protective 1/5 mm PU TechLite rand and rubber toe for extra protectionMesh liningShock absorbing/ injected EVA midsoleOrtholite Approach 4 mm footbedMega-Grip Vibram sole with Impact Brake System and climbing zone at the toe.Patented mythos lacing system380g per single/ size 42 shoe','Built for everything from approach routes to hikes and via ferrata/ the TX4 shoes are perfect for the versatile mountaineer.'),(538,'Black Diamond Wiz Kid Children\"s Climbing Harness','38870-260115102155-1700236111.jpg',212,'The Black Diamond Wiz Kid boasts Dual Core Construction/ which uses two slim bands of high-tensile webbing on the outer edges of the waistbelt and a venting OpenAir foam insert in the center for breathable/ lightweight comfort without pressure points.Black Diamond\"\"s \"\"trakFIT\"\" leg loop adjustment system means that the harness can grow along woth your kids! It uses a simple slide adjuster to quickly and easily adjust the diameter of the leg loop/ giving you a wide range of fit. ','A decked-out kids harness with all the comfort/ ventilation and durability of Black Diamonds adult harnesses.'),(539,'Black Diamond Primrose Women\"s Harness','38931-260115165230-1700236111.jpg',212,'The Black Diamond Primrose Harness is popular with all-around female climbers who don\"\"t want to waste time fiddling with leg loops and adjusting a pinching waistbelt.It features four gear loops/ trakFIT-adjustable leg loops and an ultra-comfortable waistbelt.The pre-threaded \"\"Speed Adjust\"\" waistbelt buckle saves time and eliminates error when tying in/ while Dual Core Construction [see below] keeps you comfortable even when you?re posted up at a hanging belay.TrakFIT leg-loops are easily adjusted for cool autumn days at the crag or blazing summer days on long multi-pitches/ and four pressure-moulded gear loops and a haul loop give you many carrying options.Pre-threaded \"\"Speed Adjust\"\" waistbelt buckleBullhorn-shaped waistbelt built using Dual Core ConstructionPatent-pending trakFIT adjustment for easy leg loop customizationAdjustable rear elastic riserFour pressure-molded gear loopsHaul loopWeight :   350 g [12 oz]','Black Diamond\"s most popular women\"s climbing harness for all-around use.'),(540,'Petzl Corax Harness','57772-200417145837-1700236111.jpg',212,'Durable enough to allow for both summer and winter activities/ the Corax Harness has features that provide for everything from comfort to organisation.Its FRAME technology distributes weight between the very well designed waistbelts and leg loops/ and each of the pressure points are lined with soft fabric. DoubleBack buckles allow for easy adjustments to be made/ so you can be sure that the Corax always works with your body shape.On top of being very sturdy and comfortable/ the Corax also allows you to stay organised/ whether you?re at your local climbing spot or halfway up a mountain. Two rigid front equipment loops and two flexible/ high-capacity loops in the back allow for easy access to gear without digging in a pack/ and there is also scope for using it alongside CARITOOL EVO/ if you?re using ice screws.Whatever your experience level or climbing style/ you?re in safe hands with the Corax Harness.Durable construction for summer and winter activitiesWaistbelt equipped with two DoubleBack buckles which easily adjust and center the harness/ keeping the equipment loops in optimal positionAdjustable leg loops allow easy adjustment of the harness to different body types and clothingTwo rigid front equipment loopsTwo flexible/ high-capacity equipment loops in back for carrying all necessary equipment without interfering with a backpackAccessory loop in rear centerCompatible with CARITOOL EVO for transporting ice screwsFRAME Technology design allows the weight to be distributed between the waistbelt and the leg loopsPressure points lined with soft fabricSpecificationsMaterial[s]: high-strength polyester webbing/ closed-cell foam/ polyesterCertification[s]: CE EN 12277 type C/ UIAA65-96cm waist belt48.5-59cm leg loops','Versatile/ durable and user-friendly'),(541,'Mammut El Cap Climbing Helmet','20140-130312155031-1700236111.jpg',213,'Ideal for both rock climbing and mountaineering/ the popular Mammut El Cap Helmet\"\"s hybrid design uses a hard outer shell and dual density EPS inner for a great blend of durability/ weight saving and impact protection. The addition of a compact visor will be welcome when the sun is blazing or the rain is pouring. The headband not only adjusts in diameter but also in height to give a precise fit.','An all-round climbing helmet with an innovative design.'),(542,'Grivel Salamander 2.0 Helmet','56030-090217170413-1700236111.jpg',213,'With a strong outer shell constructed using ABS to protect against penetration/ Grivel\"\"s Salamander 2.0 is the ideal choice for all types of climbing. The inner layer uses shock-absorbing polystyrene foam and the helmet has extremely efficient air circulation/ providing superb comfort and protection. One size [54-62]/ can be regulated to fit once the helmet is onAdjustment system tucks into the helmet for compact storage in your pack or haul bagMaterial: Polystyrene Foam ABSWeight: 385g','A strong helmet with a great level of adjustment/ designed for alpine/ rock/ and ice climbing.'),(543,'Camp Armour Junior Helmet','29621-080813141823-1700236111.jpg',213,'The Camp Armour Junior Helmet is a hybrid design/ combining the traditional hardshell with expanded plastic foam for a great balance of weight and protection.Includes the same features and styling as the adult version/ so it\"\"s ideal for kids who want a \"\"proper\"\" helmet. The wheel based sizing system at the back makes it very easy to get the best fit.Kid\"\"s specificHybrid constructionRotating size adjustment wheelComfort chin strapHeadlamp compatibleUIAA 106 / EN 12492 certifiedSize: 53 - 61 cm [21\"\" - 24\"\"]Weight: 310g [10.9oz]','Smaller version of this popular climbing and mountaineering helmet.'),(544,'Mammut 5er Pack Bionic Express Set','57516-060417111851-1700236111.jpg',218,'Mammut\"\"s 5er Pack Bionic Express Set gives you 5 practical/ high-end straight gate/wire gate quickdraw carabiners/ providing sturdy/ fast support that won?t freeze.Breaking load lengthwise: 25kNBreaking load across: 10kNBreaking load open: 10kNWeight: 90g [per piece]','A set of light/ yet extremely strong and durable/ quickdraw carabiners.'),(545,'Mammut Crag Express Set 10cm Quickdraw','35986-280714143342-1700236111.jpg',218,'Featuring a straight gate at one end and a bent gate at the other/ the stylish Mammut Crag Express Set 10cm Quickdraw is very robust and user-friendly.The wide-narrow-woven 10cm sling is extremely durable and very easy to hold.Weight: 111gBreaking load lengthwise: 24kNBreaking load across: 8kNBreaking load open: 8kN','The ultimate quickdraw for ambitious sports climbing.'),(546,'Camp Orbit Express KS 6 Pack Quickdraws','58196-020517162421-1700236111.jpg',218,'Durable and versatile/ the Orbit Wire Express KS 11cm Quickdraws also benefit from a lightweight/ safety-oriented design and user-friendliness.With a smooth gate action and  a convenient/ functional and practical size/ it is an ideal choice for any kind of climbing/ and the 16mm polyester dogbone is particularly thick and strong.The dogbone comes equipped with Camp\"\"s proprietary Karstop Evo carabiner retainer to prevent rope-shift.The perfect entry-level draw for all-around climbingEquipped with 2 updated Orbit Wire carabiners22kN dogbone','A pack of entry-level quickdraws for all-around climbing.'),(547,'North Ridge K1S Alpha Solidgate Quickdraw/ 11cm','27003-150313102424-1700236111.jpg',218,'Designed by Grivel for North Ridge/ this Alpha K1 Quickdraw uses a solid straightgate and solid bentgate karabiner joined by an 11cm sewn-through Dyneema sling.','A solid gate quickdraw with a short Dyneema sling for faster/ easier clipping.');
